import { CreateFinger } from '../CreateFinger/CreateFinger';
import '../GuitarTab/GuitarTab.css';

export function GuitarTab({ position }) {
  position.fingers.forEach((element, i) => {
    return (
      <div className="tabBg">
        <CreateFinger finger={position.fingers[i]} fret={position.frets[i]} />
      </div>
    );
  });
}
